import React from 'react'
import { Menu } from 'antd';
import { LaptopOutlined, LineChartOutlined, UserOutlined, ToolOutlined, HistoryOutlined } from '@ant-design/icons';
export default function Sidebar(props) {
    const renderItem = (role) => {
        if (role === 'admin') {
            return (
                <Menu theme='dark' defaultSelectedKeys={[props.key]}>
                    <Menu.Item key='1' icon={<LaptopOutlined />}>Devives</Menu.Item>
                    <Menu.Item key='2' icon={<ToolOutlined />}>Manage Devices</Menu.Item>
                    <Menu.Item key='3' icon={<UserOutlined />}>Manage User</Menu.Item>
                    <Menu.Item key='4' icon={<LineChartOutlined />} >Devices traking</Menu.Item>
                </Menu>
            )
        } else {
            return (
                <Menu theme='dark' defaultSelectedKeys={[props.key]}>
                    <Menu.Item key='1' icon={<LaptopOutlined />}>Devives</Menu.Item>
                    <Menu.Item key='2' icon={<HistoryOutlined />}>Devives history</Menu.Item>
                </Menu>
            )
        }
    }
    return (
        renderItem(props.role)
    )
}
